import sys
from Crypto.Util.number import isPrime, long_to_bytes

sys.set_int_max_str_digits(20 << 26)

n = int("")
e = 65537
c = int("")
primes = [x for x in range(2026) if isPrime(x)]
phi = 1
n_orig = n

for p in primes:
    if n % p == 0:
        phi *= p - 1
        n //= p

        while n % p == 0:
            phi *= p
            n //= p

d = pow(e, -1, phi)
m = pow(c, d, n_orig)
flag = long_to_bytes(m).decode()

print(flag)
